#!/bin/bash
# 高级混淆脚本 - 由文件管理器生成
TEMP_DIR="$(mktemp -d 2>/dev/null || echo "/tmp/script_$$")"
TEMP_FILE="$TEMP_DIR/decoded_script.sh"
ENCODED_CONTENT=""

# 清理函数
cleanup() {
    rm -rf "$TEMP_DIR" 2>/dev/null
}

# 设置陷阱确保清理
trap cleanup EXIT INT TERM

# 解码并执行
mkdir -p "$TEMP_DIR" 2>/dev/null
echo "$ENCODED_CONTENT" | base64 -d > "$TEMP_FILE" 2>/dev/null
if [ $? -ne 0 ] || [ ! -s "$TEMP_FILE" ]; then
    echo "解码失败" >&2
    exit 1
fi

chmod +x "$TEMP_FILE" 2>/dev/null
"$TEMP_FILE" "$@"
EXIT_CODE=$?
cleanup
exit $EXIT_CODE
